import React from 'react'

const UseContextExample = () => {
  return (
    <div UseContextExample>
    <h1>UseContextExample</h1>
    <Component2 user="Sneha"></Component2>
    </div>
  )
}
export const Component2 = (props) => {
    return(
        <div>Component 2
            <b>{props.user}</b>
            <Component3 user={props.user}/>
        </div>
    )
}

export const Component3 = (props) => {
    return(
        <div>Component 3
            <b>{props.user}</b>
            <Component4 user={props.user}/>
        </div>
    )
}

export const Component4 = (props) => {
    return(
        <div>Component 4
            <b>{props.user}</b>
        </div>
    )
}

export default UseContextExample
